import React, { useState, useEffect } from "react";
import { Switch, Route, Redirect } from "react-router-dom";

import Home from "../../Home";
import { Colors, media } from "../../../assets/common/Styles";
import Profile from "../../Profile";
import StickyBox from "react-sticky-box";
import { Flex, styled } from "reakit";
import HiddenMenu from "../HiddenMenu";
import LoginForm from "../../LoginForm";
import { reduxForm } from "redux-form";

import { isValid as isFormValid, submit as submitForm } from "redux-form";
import { connect } from "react-redux";

const WrapperContent = styled(StickyBox)`
  height: 500px;
  z-index: 1;
  top: 0;
  left: 0;
  background-color: #fffefe;
  overflow-x: hidden;
  transition: 0.5s;
  padding-top: 60px;
  width: 100%;
`;

const MainPage = (props) => {
  return (
    <WrapperContent>
      {console.log("fff", props)}
      <Switch>
        <Route exact path="/" component={HiddenMenu}></Route>
        <Route exact path="/home" component={Home}></Route>
        <Route exact path="/profile" component={Profile}></Route>
        <Route exact path="/login" component={LoginForm} />
        <Redirect from="/" to="/login" />
      </Switch>
    </WrapperContent>
  );
};

export default connect((store) => null, {
  submitForm,
})(
  reduxForm({
    // a unique name for the form
    form: "mainForm",
  })(MainPage)
);
